// App.js
import React from 'react';
import './App.css';
import StudentForm from './components/StudentForm';
import MarksForm from './components/MarksForm';
import GetStudentMarksForm from './components/GetStudentMarksForm';
import UpdateMarksForm from './components/UpdateMarksForm';
import GetStudentGradeForm from './components/GetStudentGradeForm';

const App = () => {
  return (
    <div className="app">
      <header>
        <h1>Student Information</h1>
      </header>
      <main>
        <section>
          <h2>Add Student</h2>
          <StudentForm />
        </section>
        <section>
          <h2>Enter Marks</h2>
          <MarksForm />
        </section>
        <section>
          <h2>Get Student Marks</h2>
          <GetStudentMarksForm />
        </section>
        <section>
          <h2>Update Marks</h2>
          <UpdateMarksForm />
        </section>
        <section>
          <h2>Get Student Grade</h2>
          <GetStudentGradeForm />
        </section>
      </main>
      <footer>
        <p>&copy; 2023 Your Website</p>
      </footer>
    </div>
  );
};

export default App;
